Here is the implementation of quicksort in Python:

```python
def quicksort(arr):
    if len(arr) <= 1:
        return arr
    else:
        pivot = arr[0]
        left = []
        right = []
        for num in arr[1:]:
            if num < pivot:
                left.append(num)
            else:
                right.append(num)
        return quicksort(left) + [pivot] + quicksort(right)

arr = [25, 20, 15, 8, 5]
print(quicksort(arr))
```

The output for the given input `[25, 20, 15, 8, 5]` will be `[5, 8, 15, 20, 25]`.

